import background from './background.jpg';
import './App.scss';
import Home from './comp/Home';
import Calendar1 from './comp/Calendar1'
import {Link,BrowserRouter,Route,Routes,HashRouter} from 'react-router-dom';
function App() {
  return (
    <HashRouter>
     <main>
        <img src={background} className='back'/>
        <h1> 일정관리 </h1>
        <Link to="/home" className='login'> 로그인 </Link>
      </main>



    <BrowserRouter>

      <Routes>
        <Route path='/home'element={<Home/>}/>
        <Route path='/calendar1'element={<Calendar1/>}/>
      </Routes>
    </BrowserRouter>
    </HashRouter>
  );
}

export default App;
